import React, { Component } from "react";
import axios from "axios";

class MostFQBenefits extends Component {
  constructor(props) {
    super(props);
    this.state = {
      facilities: [],
    };
  }

  componentDidMount() {
    this.fetchData();
  }

  fetchData = async () => {
    try {
      const response = await axios.get(
        "http://195.210.47.82:8000/facility/main/"
      );
      this.setState({ facilities: response.data });
    } catch (error) {
      console.error("Ошибка при получении данных:", error);
    }
  };

  render() {
    const { facilities } = this.state;

    return (
      <section className="programs" id="programs">
        <div>
          {facilities.map((facility, key) => (
            <div key={key}>
              <h2 className="programs__title">{facility.name}</h2>
              <div className="programs__container">
                {facility.programs.map((program, index) => (
                  <div key={index} className="programs__item">
                    <h3 className="programs__item--title">{program.title}</h3>
                    <img
                      src={program.img.Expanded}
                      alt={program.title}
                      className="programs__item--img"
                    />
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>
      </section>
    );
  }
}

export default MostFQBenefits;
